import React from 'react';

const Video = (props) => {
    return(
        <div className="col-12 col-sm-6 col-md-4 col-lg-3 mb-4">
            <div className="card">
                <video>
                    <source src={props.video.url} type="video/mp4"/>
                </video>
            </div>
        </div>
    )
}

export default Video;
